import React from 'react';
import links from './headerLinks';

import {
    Nav, 
    NavLink
} from './styled';

const HeaderComponent = () => {
    return (
        <Nav>
            {links.map((link, index) => (
                <NavItem to={link.route}>
                    link.name
                </NavItem>
            ))}
        </Nav>
    )
};

export default HeaderComponent;
